    public string FindAreaByCoordinates(double longitude, double latitude)
    {
        var settings = new JsonSerializerSettings();
        settings.Converters.Add(new GeometryConverter());

        Polygonen polygonen = JsonConvert.DeserializeObject<Polygonen>(GeoPolygonenJson, settings);
        string zoneId = FindZoneForPoint(latitude, longitude, polygonen);

        return zoneId;
    }
    private static List<List<List<double>>> ConvertPolygonCoordinates(List<List<List<object>>> coordinates)
    {
        List<List<List<double>>> convertedCoords = new List<List<List<double>>>();

        foreach (var coord1 in coordinates)
        {
            List<List<double>> coord1List = new List<List<double>>();
            foreach (var coord2 in coord1)
            {
                List<double> coord2List = new List<double>();
                foreach (var coord3 in coord2)
                {
                    if (coord3 != null)
                        coord2List.Add(Convert.ToDouble(coord3));
                }
                coord1List.Add(coord2List);
            }
            convertedCoords.Add(coord1List);
        }

        return convertedCoords;
    }

    private static List<List<List<List<double>>>> ConvertMultiPolygonCoordinates(List<List<List<List<object>>>> coordinates)
    {
        List<List<List<List<double>>>> convertedCoords = new List<List<List<List<double>>>>();

        foreach (var poly in coordinates)
        {
            convertedCoords.Add(ConvertPolygonCoordinates(poly));
        }

        return convertedCoords;
    }

    private static bool IsPointInsidePolygon(List<List<List<double>>> polygon, double x, double y)
    {
        int n = polygon[0].Count;
        bool inside = false;

        for (int i = 0, j = n - 1; i < n; j = i++)
        {
            double xi = polygon[0][i][0], yi = polygon[0][i][1];
            double xj = polygon[0][j][0], yj = polygon[0][j][1];

            // Kollar om det är en exakt punkt
            if ((xi == x && yi == y) || (xj == x && yj == y))
            {
                return true;
            }

            /* I algoritmen för att avgöra om en punkt ligger inuti en polygon används "even-odd rule" eller "ray-casting algorithm". 
                 * Detta innebär att vi ritar en horisontell linje från punkten och räknar hur många gånger linjen korsar polygonens kanter. 
                 * Om den korsar ett udda antal gånger, ligger punkten inuti polygonen. Om den korsar ett jämnt antal gånger, ligger punkten utanför polygonen. */
            if (((yi > y) != (yj > y)) && (x <= (xj - xi) * (y - yi) / (yj - yi) + xi))
            {
                double minX = Math.Min(xi, xj);
                double maxX = Math.Max(xi, xj);
                double minY = Math.Min(yi, yj);
                double maxY = Math.Max(yi, yj);

                // kontrollera om punkten är inuti en polygon
                if (x >= minX && x <= maxX && y >= minY && y <= maxY)
                {
                    return true;
                }

                inside = !inside;
            }
        }

        return inside;
    }

    private static string FindZoneForPoint(double latitude, double longitude, Polygonen polygonen)
    {
        foreach (var feature in polygonen.features)
        {
            if (feature.geometry is Polygon polygon) //Enkel Polygon
            {
                var convertedPolygon = ConvertPolygonCoordinates(polygon.coordinates);//Konverterar object till double
                if (IsPointInsidePolygon(convertedPolygon, longitude, latitude))
                {
                    return $"SE{feature.id}"; // Returnerar ID för polygonen med prisklass ex: SE1
                }
            }
            else if (feature.geometry is MultiPolygon multiPolygon) //Multi Polygon
            {
                var convertedMultiPolygon = ConvertMultiPolygonCoordinates(multiPolygon.coordinates); //Konverterar object till double
                foreach (var convertedPolygon in convertedMultiPolygon)
                {
                    if (IsPointInsidePolygon(convertedPolygon, longitude, latitude))
                    {
                        return $"SE{feature.id}"; // Returnerar ID för polygonen med prisklass ex: SE1
                    }
                }
            }
        }
        return "";
    }
